import React from 'react';
import logo from './FoodWorldPage.jpg';
import './App.css';

function MainPage() {
  return (
    <div className="MainPgae">
      <header className="MainPage-header">
		<img src={logo} className="page-logo" alt="logo" />
      </header>
    </div>
  );
}

export default MainPage;
